Текст ответа АИС:
Информацию по данному вопросу Вы можете уточнить в Вашей поликлинике, не нажимая дополнительные кнопки интерактивного меню, и дождавшись ответа специалиста контакт-центра поликлиники.

Также Вы можете оставить обращение по вопросам качества оказания медицинской помощи лечебными учреждениями следующими способами:
- обратиться по телефону горячей линии Департамента Здравоохранения Тюменской области - 8-34-52-68-45-65 или 8-800-250-30-91;
- обратиться к Главврачу в Вашей поликлиники по существующему образцу;
- оставить обращение на портале Госуслуги - https://www.gosuslugi.ru/.

Для того, чтобы узнать свою поликлинику по месту жительства, Вы можете обратиться:
- по номеру телефона Единого центра записи на первичный прием к врачу - 8-34-52-39-33-33;
- на портал Госуслуги - https://www.gosuslugi.ru/;
- по телефону горячей линии Департамента Здравоохранения Тюменской области - 8-34-52-68-45-65 или 8-800-250-30-91.
